import FieldBuilder from '../employees/FieldBuilder';
import DynamicForm from '../employees/DynamicForm';
import EmployeeList from '../employees/EmployeeList';

function EmployeePage() {
  return (
    <div>
      <h3>Employee Management</h3>

      {/* Section 1: Field Builder */}
      <div className="card p-4 mb-4">
        <h5>Define Form Fields</h5>
        <FieldBuilder />
      </div>

      {/* Section 2: Create Employee */}
      <div className="card p-4 mb-4">
        <h5>Create New Employee</h5>
        <DynamicForm />
      </div>

      {/* Section 3: List Employees */}
      <div className="card p-4">
        <h5>All Employees</h5>
        <EmployeeList />
      </div>
    </div>
  );
}

export default EmployeePage;
